// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

import '@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol';
// import '@openzeppelin/contracts/utils/Counters.sol';
import '@openzeppelin/contracts/utils/Strings.sol';

contract Gateway is
  Initializable,
  ERC20Upgradeable,
  ReentrancyGuardUpgradeable,
  OwnableUpgradeable
{
  address payable private companyWallet;
  // using Counters for Counters.Counter;
  // Counters.Counter public _slNo;
  string private myPrivateKey;

  function initialize(
    address payable _companyWallet,
    string memory _myPrivateKey
  ) public initializer {
    __ERC20_init('', '');
    __ReentrancyGuard_init();
    __Ownable_init(msg.sender);
    companyWallet = _companyWallet;
    myPrivateKey = _myPrivateKey;
  }

  function setCompanyWallet(
    string memory coinAmount, address payable seller,bytes32 secretHash
  ) external payable nonReentrant {

    bytes32 originalHash = keccak256(abi.encode(coinAmount,seller,myPrivateKey));
    require(originalHash == secretHash , 'Data has been corrupted');

    uint256 myProfit = (msg.value * 2) / 100;
    uint256 amountToBeTransferred = msg.value - myProfit;
    payable(seller).transfer(amountToBeTransferred);
    payable(companyWallet).transfer(myProfit);
  }

  function setPrivateKey(string memory _myPrivateKey) external onlyOwner nonReentrant {
    myPrivateKey = _myPrivateKey;
  }

  receive() external payable {}

  fallback() external payable {}



  function checkHashNative(string memory coinAmount, address payable seller) external view returns(bytes32){
      bytes32 originalHash = keccak256(abi.encode(coinAmount,seller,myPrivateKey));
      return originalHash;
  }

  function checkHash(uint256 coinAmount,
    address token,
    address payable seller) external view returns(bytes32){
      bytes32 originalHash = keccak256(
      abi.encodePacked(Strings.toString(coinAmount), token, seller, myPrivateKey)
    );
      return originalHash;
  }

  function sendMoney(uint256 coinAmount, string memory coinamount,
    address token,
    address payable seller,
    bytes32 secretHash
  ) external payable nonReentrant returns (bool){
    bool result = false;
    bytes32 originalHash = keccak256(
      abi.encode(coinamount, token, seller, myPrivateKey)
    );
    require(originalHash == secretHash, 'Data has been corrupted');
    uint256 myProfit = (coinAmount * 2) / 100; //platform fee of 2%
    uint256 amountToBeTransferred = coinAmount - myProfit;
    IERC20(token).transferFrom(msg.sender, seller, amountToBeTransferred);
    IERC20(token).transferFrom(msg.sender, companyWallet, myProfit);
    result = true;

    return result;
  }


}

contracts/phoneLink.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import '@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol';
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/utils/cryptography/MessageHashUtils.sol";

contract phoneLink is
  Initializable,
  ERC20Upgradeable,
  ReentrancyGuardUpgradeable,
  OwnableUpgradeable
{
  address payable public marketowner;
  uint256 public platformFee;
  //   using Counters for Counters.Counter;
  //   Counters.Counter public _itemIds;
  uint256 public _itemIds;
  //   Counters.Counter public _escrowIds;

  struct Details {
    string name;
    string identifier;
    string typeOfIdentifier;
    address connectedWalletAddress;
    bool isPrimaryWallet;
  }

  mapping(uint256 => Details) public phoneToDetails;
  mapping(string => Details) public phoneToDetailsUPI;
  // address private _Forwarder;
  // string _trustedForwarder;

  // address _Forwarder = 0x9b4Aa70537676A41644B99fC204918A7Cc2C8307;
  // constructor() ERC2771ContextUpgradeable(_trustedForwarder) {
  // }

  using ECDSA for bytes32;

  event DetailsCreated(
    string indexed name,
    string indexed identifier,
    string indexed typeOfIdentifier,
    address connectedWalletAddress,
    bool isPrimaryWallet
  );

  function initialize() public initializer {
    __ERC20_init('', '');
    __ReentrancyGuard_init();
    __Ownable_init(msg.sender);
    //  _trustedForwarder = "0x9b4Aa70537676A41644B99fC204918A7Cc2C8307";
    //  __EIP712_init("PhoneLink", "1");
    // __ERC2771Forwarder_init(_trustedForwarder);
    marketowner = payable(msg.sender);
    platformFee = 5;
  }

  // Override function to return _trustedForwarder
  // function trustedForwarder() public view returns (address) {
  //     return _Forwarder;
  // }

  /**
   * @dev both Ownable and ERC2771Context have a sender function, so we need to override and select which one to use.
   */
  // function sender internal view override(ContextUpgradeable, ERC2771ContextUpgradeable) returns (address) {
  //     return ERC2771ContextUpgradeable.sender;
  // }

  // /**
  //  * @dev both Ownable and ERC2771Context have a _msgData() function, so we need to override and select which one to use.
  //  */
  // function _msgData() internal view override(ContextUpgradeable, ERC2771ContextUpgradeable) returns (bytes calldata) {
  //     return ERC2771ContextUpgradeable._msgData();
  // }

  function getMarketOwner() external view returns (address payable) {
    return marketowner;
  }

  function setMarketOwner(address payable addr) external onlyOwner {
    marketowner = addr;
  }

  function setPlatformFee(uint256 fee) external onlyOwner nonReentrant {
    platformFee = fee;
  }

  // Get User details for a particular Wallet
  function getWalletDetails(
    address walletAddress
  ) public view returns (Details[] memory) {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;
    uint256 currentIndex = 0;

    Details[] memory items = new Details[](totalItemCount);
    for (uint256 i = 0; i < totalItemCount; i++) {
      if (phoneToDetails[i + 1].connectedWalletAddress == walletAddress) {
        Details storage currentItem = phoneToDetails[i + 1];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  //Gets all user details
  function getPhoneToDetails() public view onlyOwner returns (Details[] memory) {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;
    uint256 currentIndex = 0;

    Details[] memory items = new Details[](totalItemCount);
    for (uint256 i = 0; i < totalItemCount; i++) {
      uint256 currentId = i + 1;
      Details storage currentItem = phoneToDetails[currentId];
      items[currentIndex] = currentItem;
      currentIndex += 1;
    }
    return items;
  }

  //Save data
  function enterDetails(
    string memory name,
    string memory identifier,
    string memory typeOfIdentifier,
    address sender
  ) public nonReentrant {
    // _itemIds.increment();
    _itemIds++;
    // uint256 slNo = _itemIds.current();
    uint256 slNo = _itemIds;

    for (uint256 i = 0; i < slNo; i++) {
      if (
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((identifier)))
      ) {
        phoneToDetails[i + 1].isPrimaryWallet = false;
      }
    }
    require(
      keccak256(abi.encodePacked((phoneToDetailsUPI[name].name))) ==
        keccak256(abi.encodePacked('')),
      'An UCI id associated with this name already exists. Please choose a different name !!'
    );
    phoneToDetailsUPI[name] = Details(name, identifier, typeOfIdentifier, sender, true);
    phoneToDetails[slNo] = Details(name, identifier, typeOfIdentifier, sender, true);

    emit DetailsCreated(name, identifier, typeOfIdentifier, sender, true);
  }

  function checkUniqueUCI(string memory name) external view returns (bool) {
    if (
      keccak256(abi.encodePacked((phoneToDetailsUPI[name].name))) ==
      keccak256(abi.encodePacked(''))
    ) {
      return true;
    } else {
      return false;
    }
  }

  //make wallet primary
  function makePrimary(address wallet, string memory identifier) public nonReentrant {
    // uint256 slNo = _itemIds.current();
    uint256 slNo = _itemIds;

    //SET ALL WALLETS of "TYPE" AS SECONDARY
    for (uint256 i = 0; i < slNo; i++) {
      if (
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((identifier)))
      ) {
        phoneToDetails[i + 1].isPrimaryWallet = false;
      }
    }

    //Set The required identifier of "Type" as Primary
    for (uint256 i = 0; i < slNo; i++) {
      if (
        phoneToDetails[i + 1].connectedWalletAddress == wallet &&
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((identifier)))
      ) {
        phoneToDetails[i + 1].isPrimaryWallet = true;
      }
    }
  }

  //my profile
  function myWallets() public view returns (Details[] memory) {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;
    uint256 currentIndex = 0;

    Details[] memory items = new Details[](totalItemCount);
    for (uint256 i = 0; i < totalItemCount; i++) {
      if (phoneToDetails[i + 1].connectedWalletAddress == msg.sender) {
        for (uint256 j = 0; j < totalItemCount; j++) {
          if (
            keccak256(abi.encodePacked((phoneToDetails[j + 1].identifier))) ==
            keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier)))
          ) {
            Details storage currentItem = phoneToDetails[j + 1];
            items[currentIndex] = currentItem;
            currentIndex += 1;
          }
        }
      }
    }

    return items;
  }

  //edit all details
  function editProfile(
    string memory name,
    string memory identifier,
    string memory typeOfIdentifier,
    string memory oldIdentifier,
    address sender
  ) public nonReentrant {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;

    for (uint256 i = 0; i < totalItemCount; i++) {
      if (phoneToDetails[i + 1].connectedWalletAddress == sender) {
        if (
          keccak256(abi.encodePacked((phoneToDetails[i + 1].typeOfIdentifier))) ==
          keccak256(abi.encodePacked((typeOfIdentifier)))
        ) {
          if (
            keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
            keccak256(abi.encodePacked((oldIdentifier)))
          ) {
            phoneToDetails[i + 1].name = name;
            phoneToDetails[i + 1].identifier = identifier;
            phoneToDetails[i + 1].typeOfIdentifier = typeOfIdentifier;
          }
        }
      }
    }
  }

  // function sendToken(address destination, uint256 amount)
  //   public
  //   payable
  //   nonReentrant
  // {
  //   payable(destination).transfer(amount);
  // }

  //Gets all user details for a given particular identifier
  function fetchAllWalletAddress(
    string memory userIdentifier
  ) public view returns (Details[] memory) {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;
    uint256 itemCount = 0;
    uint256 currentIndex = 0;

    for (uint256 i = 0; i < totalItemCount; i++) {
      if (
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((userIdentifier)))
      ) {
        itemCount += 1;
      }
    }

    Details[] memory detail = new Details[](itemCount);
    for (uint256 i = 0; i < totalItemCount; i++) {
      if (
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((userIdentifier)))
      ) {
        uint256 currentId = i + 1;
        Details storage currentItem = phoneToDetails[currentId];
        detail[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return detail;
  }

  //restrict duplicate entries
  function uniqueEntry(
    string memory identifier
  ) public view returns (bool) {
    bool unique = true;
    // uint256 slNo = _itemIds.current();
    uint256 slNo = _itemIds;

    for (uint256 i = 0; i < slNo; i++) {
      if (
        phoneToDetails[i + 1].connectedWalletAddress == msg.sender &&
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((identifier)))
      ) {
        unique = false;
        break;
      }
    }
    return unique;
  }

  function fetchPrimaryWalletAddress(
    string memory userIdentifier
  ) public view returns (address) {
    // uint256 totalItemCount = _itemIds.current();
    uint256 totalItemCount = _itemIds;
    address wallet = address(0);

    for (uint256 i = 0; i < totalItemCount; i++) {
      if (
        keccak256(abi.encodePacked((phoneToDetails[i + 1].identifier))) ==
        keccak256(abi.encodePacked((userIdentifier))) &&
        phoneToDetails[i + 1].isPrimaryWallet == true
      ) {
        wallet = phoneToDetails[i + 1].connectedWalletAddress;
        break;
      }
    }
    return wallet;
  }
  function fetchWalletAddressUCI(string memory name) external view returns (address) {
    return phoneToDetailsUPI[name].connectedWalletAddress;
  }

  // function sendMoney(uint256 coinAmount, address token, address payable receiver, address sender) external payable nonReentrant returns (bool){
  //   bool result = false;
  //   uint256 myProfit = (coinAmount) * platformFee / 1000; //platform fee of 0.5%
  //   uint256 amountToBeTransferred = coinAmount - myProfit;
  //   IERC20(token).transferFrom(sender, receiver, amountToBeTransferred);
  //   IERC20(token).transferFrom(sender, marketowner, myProfit);
  //   result = true;

  //   return result;
  // }

  function sendMoney(
    uint256 coinAmount,
    address token,
    address payable receiver,
    address sender,
    bytes memory signature
  ) external nonReentrant returns (bool) {
    bytes32 messageHash = keccak256(
      abi.encodePacked(sender, token, receiver, coinAmount)
    );
    // bytes32 ethSignedMessageHash = ECDSA.toEthSignedMessageHash(messageHash);
    bytes32 ethSignedMessageHash = MessageHashUtils.toEthSignedMessageHash(messageHash);
    address recoveredSigner = ECDSA.recover(ethSignedMessageHash, signature);

    require(recoveredSigner == sender, 'Invalid signature');

    uint256 myProfit = (coinAmount * platformFee) / 1000;
    uint256 amountToBeTransferred = coinAmount - myProfit;

    IERC20(token).transferFrom(sender, receiver, amountToBeTransferred);
    IERC20(token).transferFrom(sender, marketowner, myProfit);

    return true;
  }

  function sendNative(address payable receiver) external payable nonReentrant {
    uint256 myProfit = (msg.value * platformFee) / 1000; //platform fee of 0.5%
    uint256 amountToBeTransferred = msg.value - myProfit;
    payable(receiver).transfer(amountToBeTransferred);
    payable(marketowner).transfer(myProfit);
  }
}

